import React from "react";

function Dropdown(props) {
    return <>
        <select {...props}>
            {props.options &&
                props.options.map(o =>
                    <option key={o.id_voting} value={o.name}>
                        {o.text}</option>)
            }
        </select>
    </>;
}
export default Dropdown;
